Every health maintenance organization subject to sections 62D.01 to 62D.30 shall pay to the commissioner of health fees as prescribed by the commissioner of health pursuant to section 144.122 for the following:
(1) filing an application for a certificate of authority;
(2) filing an amendment to a certificate of authority;
(3) filing each annual report; and
(4) other filings, as specified by rule.
